import React from 'react';
import Header from './header.js';
import { useState, useEffect } from 'react';

function Search_conts({list, word, page}) {
    const [curList, setCurList] = useState([]);
    setCurList(curList.slice((page-1)*10,page*10))
    return (
        <div class="div2">
            <ul>
            {curList.map((string) => {
                return(    
                <li class="left">
                {
                    string.map((str, idx) => {
                       return (
                        <p>
                        {idx === 0 ? (
                        str.map((s) => {
                            return(
                                s === word ? (
                                    <span class = "div2-title bold">{ s }</span>
                                ) : (
                                    <span class = "div2-title">{ s }</span>
                                )
                            )
                        })
                        ) : (
                        str.map((s) => {
                            return(
                                s === word ? (
                                    <span class = "div2-cont bold">{ s }</span>
                                ) : (
                                    <span class = "div2-cont">{ s }</span>
                                )
                                
                            )
                        })
                        )}
                        </p>
                       )
                    })
                }
                </li>
                )
            })}
            </ul>   
        </div>
    )
      
}


export default Search_conts;
